import { createRouter, createWebHistory } from 'vue-router'
import List from '../views/List.vue'
import Form from '../views/Form.vue'

const routes = [
  {
    path: '/',
    name: 'home',
    component: List
  },
  {
    path: '/about',
    name: 'about',

    component: Form
  }
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
